import { Link, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

//components
import Contact from './Contact';

function Navigation() {
    return (
    <div className="flex justify-between items-center bg-red-200 py-4">
        {/* left side */}
        <div className="flex items-center">
            <img src="" alt="logo" className="mr-2"/>
        </div>

        {/* right side */}
        <div className="flex justify-between">
            <a href={<Contact/>} className="inline-block px-4 text-re" >About</a>
            <a href={<Contact/>} className="" >Portfolio</a>
            <a href={<Contact/>} className="" >Blog</a>
        </div>
    </div>
    )
}

export default Navigation;
